import React from "react";
import "./MainPage.css"
const MainPage=()=>{
    return(
        <div className="container">
            <div className="navbar">
                <navbar>
                    <div></div>
                    <a href="">Resume Template</a>
                    <a href="">Resume Example</a>
                    <a href="">Cover Letter</a>
                    <a href="">Resources</a>
                    <a href="">My Account</a>
                    <a href=""><button>Build my resume</button></a>
                </navbar>
            </div>
        </div>
    )
}
export default MainPage;
